  false,\n\t\"url\": null,\n\t\"notes\": \"Reson 8101ER multibeam Data were collected
  in 19-24 April and 28 April-11 May 2006 aboard NOAA Survey Launch Acoustic Habitat
  Investigator (AHI) in the Main Hawaiian Islands at Penguin Bank, N. Shore Molokai,
  Lanai, and the Big Island of Hawaii during cruise AHI0605. These multibeam data
  were collected using SAIC ISS-2000 software in the Generic Sensor Format and processed
  using SABER editing software. Sound velocity corrections from a Seabird SBE19 CTD
  sensor and motion corrections from a POS-MV vertical reference were applied to the
  data in real time. Predicted tides were applied to the data in real time and observed
  tides were applied during post-processing. Horizontal accuracy is ~5m (differential
  GPS correctors applied), vertical accuracy is depth dependent (~1% of water depth),
  WGS84 datum. These data are not to be used for navigation. Depths mapped range from
  10 - 300 m. The AHI was deployed from the NOAA Ship Hi'ialakai and concurrent mapping
  was done using the Simrad EM300 sonars aboard the ship; metadata for HI-06-05 are
  submitted separately.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
